import "./HomeStyle.css";

function Wellcome(props) {
  return (
    <div id="welcome">
      <img
        className="center-img"
        height="60%"
        src={require("../Images/welcome-gif.gif")}
        alt="Welcome to app"
      />
      <p>Student servis</p>
    </div>
  );
}

export default Wellcome;
